(1, '<?php\r\n     $block = module_invoke(''search'', ''block_view'', ''search'');\r\n         print render($block); \r\n?>', '[Smilee] Block search sidebar', 'php_code'),
(2, '<img src="<?php print base_path() . drupal_get_path(''theme'', ''smilee'') . ''/images/basic/logo-lite.png'';?>" class="img-responsive space10" alt="smilee"/>\r\n<p>Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus</p>\r\n<div class="clearfix"></div>\r\n<ul class="f-social">\r\n    <li><a href="https://www.facebook.com" class="fa fa-facebook"></a></li>\r\n    <li><a href="https://www.twitter.com" class="fa fa-twitter"></a></li>\r\n    <li><a href="https://feedburner.google.com" class="fa fa-rss"></a></li>\r\n    <li><a href="mailto:email@website.com" class="fa fa-envelope"></a></li>\r\n    <li><a href="https://www.pinterest.com" class="fa fa-pinterest"></a></li>\r\n    <li><a href="https://www.instagram.com" class="fa fa-instagram"></a></li>\r\n</ul>', '[Smilee] Block about smilee', 'php_code'),
(3, ' <div class="tweet-info">\r\n <div id="twitterfeed"></div>\r\n  </div>', '[Smilee] Block tweets', 'php_code'),
(4, '<a href="#close" class="sb-close-btn">x</a>\r\n<div id="popup-newsletter">\r\n    <div class="block-content">\r\n        <div class="form-subscribe-header">\r\n            <label>Join Our Email Letter</label>\r\n        </div>\r\n        <div class="clearfix space30"></div>\r\n        <span class="promo-panel-sale">TAKE 25% OFF YOUR NEXT PURCHASE !</span>\r\n        <div class="clearfix space30"></div>\r\n        <span class="promo-panel-text"></span>\r\n        <div class="clearfix space30"></div>\r\n      \r\n     <?php $block = module_invoke(''webform'', ''block_view'', ''webform-client-block-35'');\r\n                print render($block[''content'']); ?>\r\n        <span class="promo-panel-text1">No Thank ! I''m not interested in this promotion </span><br>\r\n        <span class="promo-panel-text2">Entering your email also subscribe you to the latest Sunshine furniture news and offers *</span>\r\n        <label class="subscribe-bottom"><input type="checkbox"><span>Don''t show this popup again</span></label>\r\n    </div>\r\n</div>', '[Smilee] Newsletter', 'php_code'),
(5, '<div class="container">\r\n    <div class="page_header_info text-center">\r\n        <div class="page_header_info_inner">\r\n            <h2>New Arrivals</h2>\r\n            <p>Nunc tincidunt consequat elit vitae placerat. Sed id ex vel tortor ultrices accumsan. Interdum et malesuada fames ac ante ipsum primis in faucibus.</p>\r\n            <div class="ph_btn">\r\n                <a href="#">Shop Men</a>\r\n                <a href="#">Shop Women</a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>', '[Smilee] Block shop page header', 'php_code'),
